@callback(
    Output("compute-output", "children"),
    Output("benchmark-data", "data"),
    Input("compute-btn", "n_clicks"),
    State("current-image-name", "data"),
    State("current-mask-url", "data"),
    State("benchmark-data", "data"),
    State("threshold-slider", "value"),
)
def on_compute(n_clicks, image_name, mask_url, stored_data, threshold):
    if not n_clicks or n_clicks <= 0:
        return "", stored_data
    
    result = compute.run_benchmark(image_name, mask_url, threshold)

    children = []

    if not isinstance(result, dict):
        return str(result), stored_data

    # DEBUG: print json from backend
    # if isinstance(result, dict):
    #     children.append(html.Pre(json.dumps(result, indent=2)))
    # else:
    #     children.append(str(result))
    #     return children

    raw_entries = result.get("raw", [])
    if raw_entries:
        first_entry = raw_entries[0]
        url = first_entry.get("output_image")

        if url:
            full_url = f"http://localhost:8000{url}"
            children.append(
                html.Img(
                    src=full_url,
                    style={"height": "250px", "marginTop": "20px", "display": "block"},
                )
            )
    row = compute.raw_to_single_row(raw_entries)
    if stored_data is None:
        stored_data = []
    # for entry in raw_entries:
    # stored_data.append(entry)
    stored_data.append(row)
    return children, stored_data


@callback(
    Output("display-image", "src"),
    Output("mask-image", "src"),
    Output("image-filename", "children"),
    Output("image-history", "data"),
    Output("current-image-name", "data"),
    Output("current-mask-url", "data"),
    Input("upload-image", "contents"),
    Input("threshold-slider", "value"),
    State("upload-image", "filename"),
    State("image-history", "data"),
    State("current-image-name", "data"),  # AJOUT THOMAS
    State("display-image", "src"),        # AJOUT THOMAS 
)

def update_image(contents, threshold, filename, history, current_image_name, current_display_src):
    if history is None:
        history = []

    # Slider chang mais image dj uploade
    if ctx.triggered_id == "threshold-slider":
        if not current_image_name:
            return no_update, no_update, no_update, history, current_image_name, ""
        
        threshold_normalized = threshold / 100.0
        mask_resp = compute.compute_mask(current_image_name, threshold_normalized)

        if isinstance(mask_resp, str):
            return no_update, DEFAULT_IMAGE, "Erreur mask", history, current_image_name, ""

        mask_url = mask_resp.get("mask_url")
        if not mask_url:
            return no_update, DEFAULT_IMAGE, "Mask non gnr", history, current_image_name, ""

        full_mask_url = f"http://localhost:8000{mask_url}?t={int(time.time() * 1000)}"
        return no_update, full_mask_url, no_update, history, current_image_name, mask_url

    if contents is None:# AJOUT THOMAS
        return DEFAULT_IMAGE, DEFAULT_IMAGE, "", history, "", ""# AJOUT THOMAS

    upload_dir = "media/uploads"
    os.makedirs(upload_dir, exist_ok=True)

    content_type, content_string = contents.split(",")
    decoded = base64.b64decode(content_string)
    file_path = os.path.join(upload_dir, filename)
    with open(file_path, "wb") as f:
        f.write(decoded)

    threshold_normalized = threshold / 100.0
    mask_resp = compute.compute_mask(file_path, threshold_normalized)

    if isinstance(mask_resp, str):
        return contents, DEFAULT_IMAGE, "Erreur mask", history, file_path, ""

    mask_url = mask_resp.get("mask_url")
    if not mask_url:
        return contents, DEFAULT_IMAGE, "Mask non gnr", history, file_path, ""

    full_mask_url = f"http://localhost:8000{mask_url}?t={int(time.time() * 1000)}"
    history.append({"src": contents, "name": filename})
    return contents, full_mask_url, html.H5(filename), history, file_path, mask_url

@callback(
    Output("benchmark-table", "columns"),
    Output("benchmark-table", "data"),
    Input("benchmark-data", "data"),
)
def update_table(data):
    if not data:
        return [], []
    df = pd.DataFrame(data)
    columns = [{"name": col, "id": col} for col in df.columns]
    table_data = df.to_dict("records")
    return columns, table_data


